import React from "react"
import A from "../components/a"
const P = ({ children }) => {
  return (
    <p className="">
      {children}
    </p>
  )
}

const About = () => {
  return (
    <div className="w-2/3 ml-40 text-2xl font-rubik">
      <P>Cataloguing a nation&apos;s bins.</P>
      <P>Each bin is photographed in person by me, then labelled with data about local councils in
        <A href="https://local-authority-eng.register.gov.uk/">England</A>, <A href="https://local-authority-nir.register.gov.uk/">Northern Ireland</A>, <A href="https://local-authority-sct.register.gov.uk/">Scotland</A> and <A href="https://principal-local-authority.register.gov.uk/">Wales</A>.</P>
    </div>
  )
}

export default About;
